let CACHE_NAME="schedule-v1",CACHE_TARGETS=["/","/index.html"];self.addEventListener("install",e=>e.waitUntil(caches.open(CACHE_NAME).then(e=>e.addAll(CACHE_TARGETS)).then(()=>self.skipWaiting()))),self.addEventListener("activate",e=>e.waitUntil(caches.keys().then(e=>Promise.all(e.map(e=>{if(e!==CACHE_NAME)return caches.delete(e)}))).then(()=>self.clients.claim()))),self.addEventListener("fetch",e=>{"navigate"===e.request.mode&&e.respondWith(caches.match("/index.html").then(t=>t||fetch(e.request)))});